import React from "react";
import Sdata from "./Sdata"
import Card from "./Cards";


//use map function to avoid rewriting of card

// function Card_values(val){
      
//       return (    
             
//       <Card imgSrc={val.img} 
//             title={val.title}
//             sname={val.name} 
//             link={val.link}/>

//      );
// }

const App = () =>{
                    return(
                                <>
                                <h2>List of Top 5 Netflix web Series</h2>
                                <div className="Main">
                                        {Sdata.map( (val)=>{
                                                        return( <Card imgSrc={val.img} 
                                                                    title={val.title}
                                                                    sname={val.name} 
                                                                    link={val.link}/>
                                                                );
                                                        } 
                                            )
                                        }
                                </div>
                                </>
                    );
        }


        export default App;
